import React from "react";
import "./Benefits.css";
import BenefitGroup from "./BenefitGroup";

const Benefits = () => {
  const benefitIndex = [
    {
      icon: <i class="fas fa-cannabis"></i>,
      text: "Cannabis",
    },
    {
      icon: <i class="fas fa-smoking-ban"></i>,
      text: "No Smoking",
    },
    {
      icon: <i class="fas fa-smoking-ban"></i>,
      text: "No Smoking",
    },
    {
      icon: <i class="fas fa-smoking-ban"></i>,
      text: "No Smoking",
    },
  ];

  return (
    <div className="benefits-wrapper">
      <div className="benefit-group-wrapper">
        <BenefitGroup icon={benefitIndex[0].icon} text={benefitIndex[0].text} />
        <BenefitGroup
          icon={<i class="fas fa-cannabis"></i>}
          text={
            "Enter some pretty okay subtext here. This is where we go just a little more in depth"
          }
        />
        <BenefitGroup
          icon={<i class="fas fa-cannabis"></i>}
          text={
            "Enter some pretty okay subtext here. This is where we go just a little more in depth"
          }
        />
        <BenefitGroup
          icon={<i class="fas fa-cannabis"></i>}
          text={
            "Enter some pretty okay subtext here. This is where we go just a little more in depth"
          }
        />
      </div>
      <div className="benefit-slide-button-wrapper">
        <div className="benefit-slide-button active"></div>
        <div className="benefit-slide-button"></div>
        <div className="benefit-slide-button"></div>
      </div>
    </div>
  );
};

export default Benefits;
